import React, { useState, useEffect } from 'react';
import {Link} from 'react-router-dom';


function Navbar1() {
    const [id, setId] = useState("navbarState1");
    useEffect(()=> {
        if (id === "navbarState1") {
            let navbar = document.getElementById("navbarState1");
            navbar.id = "navbar1";
        } else {
            let navbar = document.getElementById("navbar1");
            navbar.id = "navbarState1";
        }
    }, [] );
    const newId = ()=> {
        if (id === "navbarState1") {
            return "navbar1";
        } else {
            return "navbarState1";
        }
    };
    return (
        <nav id={id}>
                <Link to="/"><h1>College Kitchen</h1></Link>              
                <Link to="/About">About</Link>              
                <Link to="/">Menu</Link>
                <div onClick={() => setId(newId())}></div>
        </nav>
    );
}

export default Navbar1;
